import React from 'react';
// import logo from './download.png';

const Header = () => {
    return (
        <div className="ui secondary pointing menu">
            <div className="ui container">                
                <img src="../../public/download.jpg" className="item" alt="NETFLIX" />  
            </div>
        </div>              

    )
}

export default Header;
